    text: "kjfgkg",
  },
  {
    id: "q2",
    author: "aditya singh",
    text: "dkjhbfvdj" },
];

const AllQuotes = () => {
  return <QuoteList quotes={Dummy_Quotes} />;
};

export default AllQuotes;
